import React from 'react'

export default function GroupResult() {
  return (
    <div>
       <div className='formPart'>
        <label className='excelLabel'>Upload An Excel File</label>
            <input 
            className='custom-file-input'
            type="file" 
            onChange={(e)=>{
                const file = e.target.files[0];
                readExcel(file);
            }}
            accept='.xlsx, .xls'
            />
        </div>
    </div>
  )
}
